INSERT INTO `hindi` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `image`) VALUES
(1, '3 idiots', 2009, 'Rajkumar Hirani', 8.4, 'Aamir Khan\r\nR. Madhavan\r\nSharman Joshi\r\nKareena Kapoor\r\nBoman Irani\r\nOmi Vaidya', 'Two friends are searching for their long lost companion. They revisit their college days and recall the memories of their friend who inspired them to think differently, even as the rest of the world called them \"idiots\".', ),
(2, 'Robot 2.0', 2018, ' S. Shankar', 6.5, 'Rajinikanth\r\nAkshay Kumar\r\nAmy Jackson\r\nSudhanshu Pandey', 'Dr Vaseegaran (Rajinikanth) and his android assistant Nila (Amy Jackson) are called in for help after mobiles start mysteriously flying out of the hands of people in Chennai. Vaseegaran summons his trusted robot Chitti (Rajinikanth) to ward off the bird-shaped supernatural powers of Pakshirajan (Akshay Kumar).', ),
(3, 'Dangal', 2016, 'Nitesh Tiwari', 8.5, 'Aamir Khan\r\nSakshi Tanwar\r\nFatima Sana Shaikh\r\nZaira Wasim\r\nSanya Malhotra\r\nSuhani Bhatnagar\r\nAparshakti Khurana\r\nGirish Kulkarni', 'Former wrestler Mahavir Singh Phogat and his two wrestler daughters struggle towards glory at the Commonwealth Games in the face of societal oppression.', );
INSERT INTO `hindi` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `image`) VALUES
(4, 'Dilwale Dulhania Le Jayenge', 1995, 'Aditya Chopra', 8.2, 'Shah Rukh Khan\r\nKajol', 'When Raj meets Simran in Europe, it isn\'t love at first sight but when Simran moves to India for an arranged marriage, love makes its presence felt.', ),
(5, 'Entertainment', 2014, 'Sajid-Farhad', 4.7, 'Akshay Kumar\r\nTamannaah Bhatia\r\nMithun Chakraborty\r\nJohnny Lever\r\nSonu Sood\r\nPrakash Raj\r\nKrushna Abhishek', 'Akhil, an underdog and a failure, comes to know that his real father is a rich diamond merchant who has just passed away. When he goes to retrieve his wealth, he learns that a dog has inherited it.', ),
(6, 'Hera Pheri', 2000, 'Priyadarshan', 8.2, 'Akshay Kumar\r\nSunil Shetty\r\nParesh Rawal\r\nTabu', 'Three unemployed men find the answer to all their money problems when they recieve a call from a kidnapper. However, things do not go as planned.', );
INSERT INTO `hindi` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `image`) VALUES
(7, 'Kabir Singh', 2019, 'Sandeep Vanga', 7.9, 'Shahid Kapoor\r\nKiara Advani', 'Kabir Singh is a remake of a Telugu movie Arjun Reddy (2017), where a short-tempered house surgeon gets used to drugs and drinks when his girlfriend is forced to marry another person.', ),
(8, 'Drishyam', 2015, 'Nishikant Kamat', 8.3, 'Ajay Devgn\r\nTabu\r\nShriya Saran\r\nIshita Dutta\r\nMrunal Jadhav', 'Desperate measures are taken by a man who tries to save his family from the dark side of the law, after they commit an unexpected crime.', ),
(9, 'Andaz Apna Apna', 1994, 'Rajkumar Santoshi', 8.2, 'Aamir Khan\r\nSalman Khan\r\nRaveena Tandon\r\nKarisma Kapoor\r\nParesh Rawal\r\nShakti Kapoor', 'Two slackers competing for the affections of an heiress, inadvertently become her protectors from an evil criminal.', );
INSERT INTO `hindi` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `image`) VALUES
(10, 'Chak De! India', 2007, 'Shimit Amin', 8.2, 'Shah Rukh Khan\r\nVidya Malvade\r\nShilpa Shukla\r\nSagarika Ghatge\r\nChitrashi Rawat\r\nVivan Bhatena\r\nMohit Chauhan\r\nJoyshree Arora\r\nVibha Chibber\r\nAnaitha Nair', 'Kabir Khan is the coach of the Indian Women\'s National Hockey Team and his dream is to make his all girls team emerge victorious against all odds.', );

