INSERT INTO `nepali` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `image`) VALUES
(1, 'Jatrai Jatra', 2019, 'Pradeep bhattarai', 8.1, 'Bipin Karki, Dayahang Rai, Rabindra Singh Baniya, Rabindra Jha and Barsha Rau', 'The film deals aftermath life of Fanindra, Munna and Joyes after they get released from jail on bail and also the consequences after they find bag of gold.', ),
(2, 'Pashupati Prasad', 2016, 'Dipendra K. Khanal', 8.9, 'Khagendra Lamichhane, Rabindra Singh Baniya, Bipin Karki', 'When a man named Pashuati comes to Kathmandu to pay his father loans while in Kathmandu he discovers Pashupatinath where he fights the danger of Kathmandu.', ),
(3, 'Talakjung vs Tulke', 2014, 'Nischal Basnet', 8.2, ' Khagendra Lamichhane, Dayahang Rai, Shushank Mainali', 'Tulké is a day-laborer in a Nepalese mountain village. He struggles to reclaim his lost aristocratic identity, while a violent revolution disrupts every aspect of village life.', );
INSERT INTO `nepali` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `image`) VALUES
(4, 'Chhakka Panja', 2016, 'Deepa Shree Niraula', 6.9, ' Deepak Raj Giri, Kedar Ghimire, Buddhi Tamang', 'Story of five friends Raja (Deepak Raj Giri), Saraswoti (Jeetu Nepal), Magne (Kedar Ghimire) and Buddhi (Buddhi Tamang). Raja is rich but illiterate and enjoys life, and tells his friends to not get married or hold any job. However, he secretly has affairs with married women.Then one day Raja gets married to Champa (Priyanka Karki), and the story enters a serious mode.', ),
(5, 'The Black Hen', 2015, 'Min Bahadur Bham', 7.2, 'Khadka Raj Nepali \r\nSukraj Rokaya \r\nJit Bahadur Malla \r\nBenisha Hamal \r\nHansa Khadka \r\nNanda Prashad Khatri \r\nBipin Karki \r\nPraween Khatiwada', 'The film is based on a journey embarked by two friends, Prakash and Kiran, belonging to different castes in search of a missing hen, unaware of the tyranny brought by the fragile ceasefire during the Nepalese civil war.', ),
(6, 'Loot', 2012, 'Nischal Basnet', 8, 'Saugat Malla\r\nDayahang Rai\r\nKarma Shakya\r\nPraween Khatiwada \r\nSushma Karki \r\nUttam Neupane \r\nBipin Karki', 'The film revolves around contemporary Kathmandu, Nepal where five ordinary guys try to find quick ways to get rich. The movie is about a character named Haku Kale (Saugat Malla) who, along with four others, plots to rob a bank in Kathmandu.', );
INSERT INTO `nepali` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `image`) VALUES
(7, 'Kabaddi Kabaddi', 2015, 'Ram Babu Gurung', 7.9, 'Dayahang Rai\r\nSaugat Malla\r\nRishma Gurung\r\nBuddhi Tamang\r\nSishir Bandel\r\nPriyanka Karki', 'Kabaddi Kabaddi is the continued story of Kabaddi\'s Kaji and Maiya. ', ),
(8, 'Prasad', 2018, 'Dinesh Raut', 8.5, 'Bipin Karki \r\nNamrata Shrestha \r\nNischal Basnet \r\nBasundhara Bhusal \r\nBinod Bhattarai \r\nPrakash Gandarba', 'Newly married couple face a lot of challenges when they find out they can\'t conceive.', );
INSERT INTO `nepali` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `image`) VALUES
(9, 'Kusume Rumal', 1985, 'Tulsi Ghimire', 7.1, 'Udit Narayan \r\nNeer Shah \r\nTripti Nadakar \r\nBhuwan K.C.\r\n', 'A girl falls in love with her classmate. While everything seems right, a worker starts dreaming of marrying her and another classmate tries the same by force.', ),
(10, 'Kagbeni', 2008, 'Bhusan Dahal', 7.3, 'Nima Rumba, Saugat Malla, Deeya Maskey, Hanif Mohammed, Pooja Gurung', '\r\nOld friends Krishna and Ramesh meet after ages and on their way to home, an old hermit gives them \"a monkey\'s paw\" that has the power to grant wishes. And, from then onward, the paw changes everyone\'s life.', );

