INSERT INTO `southindian` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `image`) VALUES
(1, 'Baahubali 2: The Conclusion', 2017, 'S.S. Rajamouli', 8.3, 'Prabhas\r\nRana Daggubati\r\nAnushka Shetty\r\nTamannaah\r\nSathyaraj\r\nRamya Krishna\r\nNassar\r\n', 'When Shiva, the son of Bahubali, learns about his heritage, he begins to look for answers. His story is juxtaposed with past events that unfolded in the Mahishmati Kingdom.', ),
(2, '\r\nBaahubali: The Beginning', 2015, 'S.S. Rajamouli', 8.1, 'Prabhas\r\nRana Daggubati\r\nTamannaah\r\nAnushka Shetty\r\nRamya Krishna\r\nSathyaraj\r\nNassar', 'In ancient India, an adventurous and daring man becomes involved in a decades old feud between two warring people.', ),
(3, 'Kabali', 2016, 'Pa. Ranjith', 6.3, 'Rajinikanth\r\nWinston Chao\r\nRadhika Apte\r\nSai Dhanshika', 'Returning from prison, aged gangster Kabali confronts those who had destroyed his life. While doing so, he learns about what had happened to his family when he was gone.', );
INSERT INTO `southindian` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `image`) VALUES
(4, 'Enthiran', 2010, 'S. Shankar', 7.1, 'Rajinikanth\r\nAishwarya Rai\r\nDanny Denzongpa', 'A brilliant scientist builds a humanoid robot to protect mankind, but things go awry when human emotions are programmed and inner turmoil causes the robot to act against him.', ),
(5, 'Mersal', 2017, 'Atlee Kumar', 8, 'Vijay\r\nS. J. Surya\r\nNithya Menen\r\nSamantha Akkineni\r\nKajal Aggarwal\r\nVadivelu\r\nSathyaraj', 'A magician and a doctor attempt to expose the corruption at the heart of India\'s medical industry.', ),
(6, 'Sarkar', 2018, 'A.R. Murugadoss', 7.1, 'Vijay\r\nKeerthy Suresh\r\nVaralaxmi Sarathkumar \r\nYogi Babu \r\nRadha Ravi', 'Sundar Ramasamy, an NRI businessman, returns home and learns about the practice of illegal voting. When he decides to investigate the matter, he finds himself pitted against two corrupt politicians.', );
INSERT INTO `southindian` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `image`) VALUES
(7, 'I', 2015, 'S. Shankar', 7.4, 'Vikram\r\nAmy Jackson\r\nSuresh Gopi', 'A simple body builder\'s life took an unexpected turn when he became a model by his beloved . When five men made his life \'better from hell\' then story proceeds by how a disabled man took revenge from them in a very gore ways.', ),
(8, 'K.G.F: Chapter 1', 2018, ' Prashanth Neel', 8.3, 'Yash\r\nSrinidhi Shetty\r\nAnant Nag\r\nVasishta N. Simha', 'Set in the 1970s, it\'s the story of a fierce rebel who rises against the brutal oppression and becomes the symbol of hope to legions of downtrodden people.', ),
(9, 'Petta', 2019, 'Karthik Subbaraj', 7.4, 'Rajinikanth\r\nVijay Sethupathi\r\nSimran\r\nTrisha Krishnan\r\nM. Sasikumar\r\nNawazuddin Siddiqui\r\nBobby Simha\r\nSananth Reddy\r\nMegha Akash\r\nMalavika Mohanan', 'Though he works as a hostel warden, there is more to Kaali than meets the eye. Things take an interesting turn when Kaali\'s path crosses with a group of dreaded gangsters.', );
INSERT INTO `southindian` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `image`) VALUES
(10, 'Rangasthalam', 2018, 'Sukumar', 8.5, 'Ram Charan \r\nSamantha Akkineni\r\nAnasuya Bharadwaj\r\nAadhi Pinisetty\r\nJagapathi Babu\r\nPrakash Raj', 'The fear of his elder brother\'s death starts to haunt an innocent, hearing impaired guy after they both join forces to overthrow the unlawful 30 year long regime of their village\'s president.', );

